import React from 'react'

export default function WorkoutPage(props) {


const opneWorkout = () =>{}


  return (
    <div style={{border: "1px solid green", margin:"5px"}} onClick ={opneWorkout} disabled ={props.Workout.isDone}>
        <h4>Workout N.O {props.Workout.wNumber}</h4>
        <p>{props.Workout.km} KM </p>
        </div>
  )
}
